sys_variable_value.value:
(function execute(inputs, outputs) {
    var successCodes = ['200', '202', '201'];
  	var response = JSON.parse(inputs.response_body);
    var arrayUtil = new global.ArrayUtil();
    if (arrayUtil.contains(successCodes, inputs.status)) {
        outputs.status = 'Success';
      	outputs.configuration_details = response;
      	if (JSON.stringify(response.tags) != '{}') {
            var keys = Object.keys(response.tags);
            var tags = [];
            for (var i = 0; i < keys.length; i++) {
                var tag = {};
                tag.name = keys[i];
                tag.value = response.tags[keys[i]];
                tags.push(tag);
            }
            outputs.configuration_details.tags = tags;
        }
    } else {
        outputs.status = 'Error';
      	if(response.error)
        	outputs.error_message = response.error.message;
      	else
          	outputs.error_message = response.message;
    }
})(inputs, outputs);

